import React from "react";
import "./MensPage.css";

const MensProduct = ({ lists, addToCart }) => {

  // console.log(page);
  return (
    <>
      <div className="containerr">
        {lists.map((curr) => {
          return (
            <>
              <div className="inside" key={curr.id}>
              <div className="items">
                <img width={"50"} src={curr.img}/>
                </div>

                <div className="items">
                  <p>
                    <span>Name:</span>
                    {curr.title}
                  </p>
                </div>
                <div className="items">
                  <p>
                    <span>Category:</span>
                    {curr.Category}
                  </p>
                </div>
                <div className="items">
                  {" "}
                  <p>
                    <span>Price:</span>
                    {curr.price}
                  </p>
                </div>
                <div className="items">
                  {" "}
                  <p>
                    <span>Add to Cart:</span>
                    <button onClick={() => addToCart(curr)}>+</button>
                  </p>
                </div>
              </div>
            </>
          );
        })}
      </div>
      
    </>
  );
};

export default MensProduct;
